    title: "My First Book",
    description: "The first book I ever wrote",
  },
];

const Products = () => {
  return (
    <section className={classes.products}>
      <h2>Buy your favorite products</h2>
      <ul>
        <ProductItem
          title="Test"
          price={6}
          description="This is a first product - amazing!"
        />
        <ProductItem
          title="SergioTest"
          price={11}
          description="Very cool vea"
        />
      </ul>
    </section>
  );
};

export default Products;
